import { HttpClientModule } from '@angular/common/http';
import { NgModule } from '@angular/core';
import { BrowserModule } from '@angular/platform-browser';
import { RouterModule } from '@angular/router';
import { ReactiveFormsModule } from '@angular/forms';

import { AppComponent } from './app.component';
import { TopBarComponent } from './top-bar/top-bar.component';
import { ProductListComponent } from './product-list/product-list.component';
import { ProductAlertsComponent } from './product-alerts/product-alerts.component';
import { EventAlertsComponent } from './event-alerts/event-alerts.component';
import { ProductDetailsComponent } from './product-details/product-details.component';
import { CartComponent } from './cart/cart.component';
import { ShippingComponent } from './shipping/shipping.component';
import { DiscountBarComponent } from './discount-bar/discount-bar.component';
import { SportsComponent } from './sports/sports.component';
import { WomenComponent } from './women/women.component';
import { MenComponent } from './men/men.component';
import { WishlistComponent } from './wishlist/wishlist.component';



@NgModule({
  imports: [
    BrowserModule,
    HttpClientModule,
    ReactiveFormsModule,
    RouterModule.forRoot([
      { path: 'homepage', component: ProductListComponent },
      { path: 'products/:productId', component:
      ProductDetailsComponent },
      { path: 'cart', component: CartComponent },
      { path: 'shipping', component: ShippingComponent },
      { path: 'sports', component: SportsComponent },
      { path: 'women', component: WomenComponent },
      { path: 'men', component: MenComponent },
      { path: 'wishlist', component: WishlistComponent }
    ])
  ],
  declarations: [
    AppComponent,
    TopBarComponent,
    ProductListComponent,
    ProductAlertsComponent,
    EventAlertsComponent,
    ProductDetailsComponent,
    CartComponent,
    ShippingComponent,
    DiscountBarComponent,
    SportsComponent,
    WomenComponent,
    MenComponent,
    WishlistComponent,
   
  
  ],
  bootstrap: [
    AppComponent
  ]
})
export class AppModule { }
